(13118, 'ENC2799 - Hanging Lampshade-IDE', '', NULL, '', 'ENC2799 - Hanging Lampshade-IDE', 'Jawohl', 'Pendelleuchte', '', 'Retro 3 Köpfe Rustikal Rot Hängendes Zubehör Deckenleuchte Abdeckung Dekorative Käfigleuchte', 'Pendant Lights', 'Pendant Lampshade', '<p><strong>Produktbeschreibung</strong></p>\r\n<ul>\r\n    <li>100% nagelneu und hohe Qualit&auml;t</li>\r\n</ul>\r\n<p><strong>Merkmale:</strong></p>\r\n<ul>\r\n    <li>Nicht nur Beleuchtung, sondern auch Dekoration Ihres Hauses.</li>\r\n    <li>Es wird Ihr Zuhause interessanter und attraktiver machen.</li>\r\n    <li>E27-Lampensockel, Sie k&ouml;nnen beliebige Lampen mit der E27-Schnittstelle ausw&auml;hlen, wie Sie m&ouml;chten.</li>\r\n    <li>Perfekt, um eine warme, romantische Atmosph&auml;re f&uuml;r Ihr Zuhause, Restaurants und Caf&eacute;s zu schaffen.</li>\r\n</ul>\r\n<p><strong>Spezifikationen:</strong></p>\r\n<ul>\r\n    <li>Basistyp: E27</li>\r\n    <li>Stromquelle: AC110V-250V</li>\r\n    <li>Lampenfassung Menge: 3</li>\r\n    <li>Artikelfarbe: Rustikales Rot</li>\r\n    <li>Material: Metall + PVC</li>\r\n    <li>Kabell&auml;nge: 95 cm (PVC-Kabel)</li>\r\n    <li>Deckenplatte: 20 cm Durchmesser x 2,5 cm H / 50 cm L&auml;nge x 6 cm Breite x 2,5 cm H&ouml;he</li>\r\n</ul>\r\n<p><strong>Lieferinhalt:</strong></p>\r\n<ul>\r\n    <li>1 x Pendelleuchtensockel</li>\r\n    <li>3 x Lichthalter mit 95 cm Kabel (Die Gl&uuml;hbirnen sind optional)</li>\r\n    <li>3 x Lichtschirme</li>\r\n    <li>1 x Teile zusammenbauen</li>\r\n</ul>\r\n<p><strong>Notiz:</strong></p>\r\n<ul>\r\n    <li>Die auf Fotos angezeigte Artikelfarbe kann auf Ihrem Computermonitor leicht abweichen, da die Monitore nicht gleich kalibriert sind.</li>\r\n    <li>Die Lieferzeiten k&ouml;nnen je nach Bestimmungsort variieren. Wir raten davon ab, einen Elektriker oder Installateur zu beauftragen, bis Sie alle Artikel in zufriedenstellendem Zustand erhalten haben.</li>\r\n</ul>', '', 'Pendelleuchte Deckenleuchte Anhänger Vintage Lampenschirm Hän