(13113, 'CRFF108+WSSS70+WCBL - Wall light-IDE', '', NULL, '', 'CRFF108+WSSS70+WCBL - Wall light-IDE', 'Jawohl', 'Wandleuchte', '', 'Vintage Industrial Retro Metal Light Shade Verstellbare Deckenwandleuchte Befestigung', 'Lampshades', 'Wire Cages', '<p><strong>Beschreibung</strong></p>\r\n<ul>\r\n    <li>Dieser Wandleuchtenk&auml;fig aus Metall wurde entwickelt, um Ihrer Wohnkultur einen Hauch eristischer Eleganz zu verleihen. Er passt gut zu anderen Gegenst&auml;nden und verst&auml;rkt die Eleganz Ihres Interieurs.</li>\r\n    <li>Mit seinem charmanten Stil ist es eine wunderbare Wahl, um die gew&uuml;nschten modischen und funktionalen Anforderungen Ihres Hauses zu erf&uuml;llen.</li>\r\n    <li>Perfekt f&uuml;r Ihr Wohnzimmer, Esszimmer, Caf&eacute;, Bar und mehr, diese modernen Wandleuchtenschirme sind eine gro&szlig;artige M&ouml;glichkeit, jedem Raum in Ihrem Zuhause einen modernen Stil zu verleihen.</li>\r\n    <li>Einfach und schnell zu installieren, enth&auml;lt alle Montageteile f&uuml;r eine schnelle und einfache Installation.</li>\r\n    <li>Hochwertiges Metall.</li>\r\n    <li>Lampenk&auml;fig aus verdicktem Metall, &uuml;berlegenes Material und hervorragende Verarbeitung.</li>\r\n    <li>Vintage-Metalllampendesign, antik, um den alten Prozess zu machen, erh&ouml;ht die emotionale Anziehungskraft von Vintage.</li>\r\n</ul>\r\n<p><strong>Produktspezifikationen:</strong></p>\r\n<ul>\r\n    <li>K&auml;figdurchmesser: 11 cm</li>\r\n    <li>K&auml;figh&ouml;he: 24 cm</li>\r\n    <li>Schirmform: Fass</li>\r\n    <li>Schirmfarbe: Schwarz / Gelbes Messing</li>\r\n    <li>Material: Metall</li>\r\n    <li>Typ: Wandlampe</li>\r\n    <li>Arbeitsspannung: 110-240V</li>\r\n    <li>Gl&uuml;hbirne enthalten: Optional</li>\r\n</ul>\r\n<p><strong>Packungsinhalt:</strong></p>\r\n<ul>\r\n    <li>1 x Lampenhalter mit Arm</li>\r\n    <li>1 x Lichtk&auml;fig</li>\r\n    <li>1 x Deckenrosette mit passendem Zubeh&ouml;r</li>\r\n    <li>(Die Gl&uuml;hbirne ist optional)</li>\r\n</